import React from "react";

const SubmitPage = () => {
  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-4">Submit a Barbershop</h1>
      <p className="text-gray-700">
        This is where users can add a barbershop to the directory.
      </p>
    </div>
  );
};

export default SubmitPage;
